A questão é que os técnicos brasileiros, (até os consagrados) colocam os times pra jogar de maneira antiquada...observava isso, quando Mano Menezes passou por aqui,...Sem contar que no geral o futebol brasileiro tá fraco tecnicamente, antigamente formavamos uma seleção e ainda ficava vários craques de fora. 
Enfim, o fluminense teoricamente tem um ótimo time, com jogadores experientes, poderia fazer uma tentativa com um técnico estrangeiro tb né, o negócio são as politicagens.

